import { Button } from 'semantic-ui-react'

class PopUp extends React.Component {
    render() {

        /* const {onSave, onChoose} = this.props */

        return (
                <div>
                    Do you want to Save the Playlist and Start a new one?
                    <Button onClick={this.props.onSave} onClick={this.props.onChoose} >Save</Button>
                    <Button onClick ={this.props.onChoose} >Back</Button>
                </div>
        )
    }
}

export default PopUp;
